import React, { useState } from "react";
import "./style.css";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import Card from 'react-bootstrap/Card'
import Data from "./Data"

const Home = () => {
  const logo =
    "data:image/png;base64,";
 
 const [food,setFood]=useState(Data)
    return (
    <>
 {food.map((item,k)=>{
    
      <div className="container">

        <div className="head">
          <img src={logo} alt="no img"></img>
          <p>Search filter App</p>
        </div>

        <Form
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <Form.Group className=" mx-2 col-lg-5" controlId="formBasicEmail">
            <Form.Control type="email" placeholder="Search for Reastaurants" />
          </Form.Group>
          <Button variant="danger" type="submit" className="col-lg-1">
            Submit
          </Button>
        </Form>

          <section>
            <h2>Reastaurants in Hyderabad open now</h2>

           
            <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src={item.imgdata} />
      <Card.Body>
        {/* <Card.Title>Card Title</Card.Title> */}
        {/* <Card.Text>
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </Card.Text> */}
        {/* <Button variant="primary">Go somewhere</Button> */}
        <div className="uppertext">
            <p className="restaurant">Massala Theory</p>
            <p className="rating">3.8✩</p>
        </div>
        <div className="middletext">
            <p className="cuisine">North Indian,Biriyani,Mughlai</p>
            <p className="cost">₹350 for one</p>
        </div>

        <div className="line"></div>

      </Card.Body>
    </Card>

          </section>

      </div>
      })}
    </>
  );
};

export default Home;
